        [head=65]Aussec Security Suite[/head]


        Congratulations on the installation of your [bold]Aussec Security Suite[/bold]. This short guide will run you through the functions of each button.


        [bold]Desk Shutters[/bold] operates the exterior shutters of the front desk, useful for silencing rioters who complain.


        [bold]Open Doors[/bold] operates the front doors to allow civilians entrance into security - or exit, if you're feeling inclined.


        [bold]Janitor Light[/bold] toggles the exterior janitor light, to alert the janitor that you have another blood spill.


        [bold]Entrance Lockdown[/bold] toggles the entrance blast doors, for the most extreme circumstances where security is at risk of being overrun.


        [bold]Cell Shutters[/bold] toggles the holding cell shutters to prevent criminal scum from communicating with their accomplices.


        [bold]Perma Lockdown[/bold] toggles the permabrig blast doors, for containing the most extreme prison riots.
