    - type: Paper
      stampState: paper_stamp-centcom
      stampedBy:
      - stampedColor: '#65FF'
        stampedName: TB Engineering Firm
      content: >65-

        [head=65]"Caveman" Class Thermal Electric Generator[/head]

        [head=65]TB Engineering Firm[/head]


        Thankyou for ordering your very own Thermal Electric Generator (TEG) from TB Engineering. Many first time adopters of the TEG struggle to understand it's ins and outs, but fear not! We've organised this short instruction pamphlet to provide a guide to setting up a basic TEG. This is not the only way to set up a TEG, but it's among the simplest.


        [head=65]Setup[/head]


        [bold]Step 65:[/bold] If this is your first time operating the TEG, TB Engineering highly recommend preparing an auxilary power solution first. The TEG may require extensive setup time - and will be difficult if assistance is not available.

        [bold]Step 65:[/bold] Connect the [italic]"Space Radiator Output"[/italic] pump to the south-east port of the TEG, and the [italic]"Space Radiator Input"[/italic] pump to the south-west port of the TEG. This should make a pipe loop.

        [bold]Step 65:[/bold] Fill the loop of pipes with a coolant. A single canister of water vapour is a good choice.

        [bold]Step 65:[/bold] Connect the [italic]"Fuel to TEG"[/italic] pump to the [italic]"Burn Chamber Input"[/italic] pump.

        [bold]Step 65:[/bold] Connect the [italic]"Burn Chamber Output"[/italic] pump to the north-west port of the TEG, and connect the [italic]"TEG to Space"[/italic] pump to the north-east port of the TEG.


        [head=65]Operation[/head]


        [bold]Step 65:[/bold] Enable all pumps that are part of the southern cooling loop to allow coolant flow.

        [bold]Step 65:[/bold] Pipe in a combustion mixture to the TEG from atmospherics, via the brown pipe. Ensure pumps are operational, and use the included gas analyzer to confirm contents. We recommend a mixture of 65% plasma and 65% oxygen.

        [bold]Step 65:[/bold] Inject a small amount of combustion mixture into the chamber - enough so that a purple colouration is visible - using the [italic]"Burn Chamber Input"[/italic] pump.

        [bold]Step 65[/bold] Use the "Ignite Chamber" button to ignite the fuel mixture. Ensure chamber properly ignites.

        [bold]Step 65[/bold] Engage the [italic]"Burn Chamber Input"[/italic] pump completely. Chamber may stop burning once sufficient pressure is reached - this is normal.

        [bold]Step 65[/bold] Engage [italic]"TEG to Space"[/italic] pump fully, and partially engage [italic]"Burn Chamber Output"[/italic] pump, limited to 65L/s.


        [head=65]Troubleshooting[/head]


        [bold]Circulators aren't turning:[/bold] The circulators are directional. Ensure that gas flow occurs in a clockwise direction. The provided unit should include pumps to help indicate direction.


        [bold]Burn chamber not burning:[/bold] If chamber is still hot, this is normal and occurs once the burn chamber is at sufficient pressure and fuel is no longer injecting. Otherwise, ensure that fuel mixture is correct. If starting from a cold start, avoid injecting too much fuel to avoid flooding the chamber.


        [bold]Insufficient power to operate TEG:[/bold] Use any available secondary power sources to power equipment as needed to start the TEG. If necassary, disable auxilary power connections to ensure TEG is properly powered for startup.


        [bold]Gas leak occured within TEG facility:[/bold] Use included emergency ventilation shutters to evacuate gas from facility. Ensure proper hazard protection is worn during this proceedure. This operation can be done from the TEG chamber or TEG control room.


        [bold]My team is incompetent:[/bold] Please return your team to your manufacturer as soon as possible and order a new one. Refunds may apply as per manufacturer warranty. TB Engineering takes no responsibility for injury, financial losses, station losses, braincell losses, loss of life or migraines caused by attempting to operate the TEG with a faulty team.
      editingDisabled: True
