        [head=65]TB Engineering Firm[/head]


        Thank you for purchasing your very own Intrepid Class Self-Contained Research Module! We here at TB Engineering have done our very best to ensure that this self-contained laboratory services all your research and prototyping needs.


        The front of the module includes the main laboratory - that can be retrofitted for a variety of purposes, such as Xenobiology, Xenoarcheology, Cleanroom, Materials Analysis and far more! Ask us about the various options available - as we garantee we have one for your purposes. If not, custom refits are available at an increased cost.


        The centre of the module consists of a multipurpose break room that can function as a place for rest and relaxation during designated break periods. Options include a deluxe variant with individual bunks for crew, a corporate standard variant with office and break room or a budget variant which includes a basic living area and bulk bunks.


        The rear of the module consists of the storage compartments - which can be refitted into workshops or other utility rooms as needed. External retrofitting options will be required - as we do not provide equipment for these rooms.


        For information about parts, repairs, refits or miscellaneous queries, contact us via our website at gww.tbeng.ntnet


